import "@nomicfoundation/hardhat-toolbox";
import { HardhatUserConfig } from "hardhat/types";

const config: HardhatUserConfig = {
  solidity: "0.8.20",
  networks: {
    ganache: {
      url: "http://127.0.0.1:7545",
      gas: "auto",
      gasPrice: "auto",
      timeout: 10000,
      chainId: 1337,
      accounts: [
        // 0
        // `0xd923a97d08ac110a423ec79bdbefb8f25c8b39f271ce4fb90145dbcfbd5aa337`,
        // 7
        `0x40ad2cb3ad99d83e1cc4a1d4c402023b0899d57716444c8c71002980d02952bc`,
      ],
    },
  },
};

export default config;

import { ContractRunner } from "ethers";
import { Marketplace__factory } from "../typechain";


export class MarketplaceContract extends Marketplace__factory {
    constructor() {
        super();
    }
    readonly ADDRESS = '0x5587564f2e88ee14BEEFc4C0912FA93908D4dE3f';

    connect(provider:ContractRunner):Marketplace__factory{
        return super.connect(provider);
    }

}

